import React, { useState } from 'react';

const FirstHook = () => {
    const [name, setName] = useState('Shubham');

    handleNameChange = (e) => {
        setName(e.target.value);
    }

    return(
        <input 
        value={name}
        onchange={handleNameChange}
        />
    )
}

export default FirstHook;
